import * as React from 'react';
import { Avatar, Button, Card, Title, Paragraph } from 'react-native-paper';

const LeftContent = props => <Avatar.Icon {...props} icon="folder" />

const Cardd = () => (
  <Card>
    <Card.Title title="Card Title" subtitle="Card Subtitle" left={LeftContent} />
    <Card.Content>
      <Title>Red Bull</Title>
      <Paragraph>Card content</Paragraph>
    </Card.Content>
    <Card.Cover  style={{width:"100%", height:"50%"}} source={{ uri: 'https://resizer.glanacion.com/resizer/mxeqvpk5Jn0K_R74cpXSjCd9A8k=/768x0/filters:quality(80)/cloudfront-us-east-1.images.arcpublishing.com/lanacionar/7XM7EBGWMZDY5B6HZ7CV7TPXO4.JPG' }} />
    <Card.Actions>
      <Button>Cancel</Button>
      <Button>Ok</Button>
    </Card.Actions>
  </Card>
);

export default Cardd;
